import { useState } from "react";

export default function App() {
  const [currentView, setCurrentView] = useState("login");
  const renderView = () => {
    switch (currentView) {
      case "dashboard":
        return <Dashboard />;
      case "login":
        return <Login />;

      default:
        return <div>Page not found</div>;
    }
  };
  return <div>{renderView()}</div>;
}

function Dashboard() {
  return <p>Dashboard</p>;
}

function Login() {
  return <p>Login</p>;
}
